import React, { Component } from 'react'
import ShortestPath from './ShortestPath'
import Canvas from './canvas'
import HomeComponent from './HomeComponent'
import MST from './MST'
import {NavLink, Switch, Route,Redirect} from 'react-router-dom'

export class MainComponent extends Component {
    render() {
        return (
            <div>
            <NavLink to='/bfsdfs'>Graph Traversal Algo</NavLink>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <NavLink to='/dijkstra'>Shortest Path Algo</NavLink>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <NavLink to='/KruskalMST'>Kruskal's Minimal Spanning Tree</NavLink>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <NavLink to='/PrimMST'>Prim's Shortest Path Algo</NavLink>
                <Switch>
                    <Route path='/home' component={HomeComponent}/>
                    <Route path='/bfsdfs' component={Canvas}/>
                    <Route path='/dijkstra' component={ShortestPath}/>
                    <Route path='/PrimMST' component={ShortestPath}/>
                    <Route path='/KruskalMST' component={MST}/>
                    <Redirect to='/home' />
                </Switch>
            </div>
        )
    }
}

export default MainComponent
